ui.css:
a { color: blue; }
.brandname { font-weight: bold; color: #677589; }
.card, .p1 { padding: 0.25em 0.8em; }
.panel, .p2 { padding: 0.5em 0.8em; }
.card, .panel, .box { background: white; border: 1px solid #ddd; border-radius: 0.5em; }
.row { display: flex; }
.page, .panel, .col { display: flex; flex-direction: column; }
.size-equal { flex: 1 1 0; }
.size-auto { flex: 1 1 auto; }
.title, .small { font-size: 95%; }
.note { background: #dcfce7; border: 1px solid #86efac; color: #0c4a6e; }
.note > * { font-size: 90%; }
.val, .title, .nowrap { white-space: nowrap; text-overflow: ellipsis; }
.val, .big { font-size: 125%; }
.card { background: #e2e8f0; border: 1px solid #cbd5e1; }
.val, .title, .bold { font-weight: bold; }
.val, .title, .slate { color: #475569; }
.label { color: #475569; font-size: 95%; }
.link { color: blue; text-decoration: underline; }
.page { padding: 0.75em; gap: 0.75em; min-height: 2em; }
.wrap { flex-wrap: wrap; }
@media (max-width: 640px) {
.col, .row { flex-wrap: wrap; }
.panel { flex: 1 1 100% !important;}
